import './Card.css';

function Card(props) {
    //props.children is the reserved property of REACT which allows us to use Custom component in place
    //of standard html tag in return statement of react component
    const cssClasses = 'card ' + props.className; 
    return <div className={cssClasses}>{props.children}</div> 
}
export default Card;
